import "./ProjectsScreen.css";

function ProjectsScreen()
{
    const Button = ({style, text, onClick}) =>
    {
      return(
        <button type="button" className={style} onClick={onClick}>
          {text}
        </button>
      );
    }

    return(
        <section>
            <Button text="FlixFinder"> </Button>
        </section>
    );
}
